private static boolean methodExists(int methodHash, long version,
    Map<Long, ProtocolSignature> versionMap) {
  ProtocolSignature sig = versionMap.get(version);
  if (sig != null) {
    for (int m : sig.getMethods()) {
      if (m == methodHash) {
        return true;
      }
    }
  }
  return false;
}
